import Navi from "../components/Navi";
import ItemLibrary from "../components/ItemLibrary";
import React, { Component } from 'react'

export default class Home extends Component {
  render() {
    return (
      <div>
        <div>
      <Navi />
     
      {this.props.books
        .filter((book) => {
          if (this.props.filteredData == "") {
            return book;
          } else if (
            book.title.toLowerCase().includes(this.props.filteredData.toLowerCase())
          ) {
            return book;
          }
        })
        .map((book, index) => (
          <ItemLibrary key={index} book={book} />
        ))}
    </div>
      </div>
    )
  }
}
